INSERT INTO `v1_735cdef130dc259ff4820de8357e4eefcbdcb252729f6f115aba798da0a09dc1` VALUES (1, "スタンダードコレクションではポスターやペナントなど\n部屋に飾れる定番グッズが盛りだくさん！\nあなたの部屋をカルミナで彩ろう！", 1, "スタンダードコレクション", "1回メダル{0}枚！\n定番グッズであなたの部屋をカルミナで彩ろう！", 3);
INSERT INTO `v1_735cdef130dc259ff4820de8357e4eefcbdcb252729f6f115aba798da0a09dc1` VALUES (1, "プレミアムコレクションではサイン色紙や\nブロマイドなど、★★以上のグッズが盛りだくさん！\nレアグッズをたくさんゲットしよう！", 2, "プレミアムコレクション", "1回メダル{0}枚！\nメンバー直筆サイン色紙など、★★以上のグッズを確定でゲット！", 10);
